import React from "react";

const Login = () => (
    <nav className="login">
        <h2>Inventory Login</h2>
        <p> Sign in to manage your store's inventory</p>
        <button className="github" onClick={() => this.props.authenticate('Github')}>Login </button>
    </nav>
);

export default Login;
